const App = () => {
  return (
    <div className='container'>
				<h1 className='mt-3'>SpendSmart</h1>
				<div className='row mt-3'>
					<div className='col-sm'>
						<Budget />
					</div>
					<div className='col-sm'>
						<Remaining />
					</div>
          <br />
					<div className='col-sm'>
						<ExpenseTotal />
					</div>
				</div>
			</div>
  )
};

export default App;
